window.bookSummaryJSON = "<p>Michael </p> <p>Being traded after fighting with your coach on air isnâ€™t exactly a good look. With one mistake under my belt, I knew I needed to focus on the game and nothing else. But everything changed when I went to pick up my niece and came face-to-face with my very pregnant one-night stand from six months ago. </p> <p>Jillian </p> <p>Two pink lines changed all my plans. So did the guy I had a one-night stand with, a man who made me laugh and smile, a guy who I called to share my unexpected news with, only to find out his number was no longer in service. Once more let down by the opposite sex, I figured I was doing this on my own. Then one day, I was staring into the eyes of the man I hated, the father of my baby.</p>"; 
